import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LandingPage from './LandingPage.Tsx';

function App() {
    return (
    <Router>
      <Routes>
        <Route index path="/" element={<LandingPage />} />
      </Routes>
    </Router>
  );

}

export default App;
